function currentTime() {
	//const clock = document.getElementById("clock")
    let date = new Date()
    let hh = date.getHours()
    let mm = date.getMinutes()
    let ss = date.getSeconds()
    let ms = date.getMilliseconds()
    hh = (hh < 10) ? "0" + hh : hh
    mm = (mm < 10) ? "0" + mm : mm
    ss = (ss < 10) ? "0" + ss : ss
    ms = (ms < 100) ? (ms < 10) ? "00" + ms : "0" + ms : ms
    let time = hh + ":" + mm + ":" + ss + "." + ms
    clock.innerHTML = time + clock.innerHTML.slice(12)
    var t = setTimeout(function(){currentTime()},17)
}
function togcorndogs() {
	switch (snow.classList.contains("nocorndogs")) {
		case true:
			snow.classList.remove("nocorndogs")
			break
		case false:
			snow.classList.add("nocorndogs")
			break
	}
}
function tograinbow() {
	switch (snow.classList.contains("rainbow")) {
		case true:
			snow.classList.remove("rainbow")
			break
		case false:
			snow.classList.add("rainbow")
			break
	}
}
function togfont() {
	switch (snow.classList.contains("font")) {
		case true:
			snow.classList.remove("font")
			if (splash) {splash.classList.remove("font")}
			break
		case false:
			snow.classList.add("font")
			if (splash) {splash.classList.add("font")}
			break
	}
}
function togfancy() {
	switch (snow.classList.contains("nofancy")) {
		case true:
			snow.classList.remove("nofancy")
			if (splash) {splash.classList.remove("nofancy")}
			break
		case false:
			snow.classList.add("nofancy")
			if (splash) {splash.classList.add("nofancy")}
			break
	}
}
